import heapq

def nthUglyNumber(n):
    heap = [1]
    seen = {1}
    res = 0

    for _ in range(n):
        res = heapq.heappop(heap)
        for i in [2, 3, 5]:
            ugly = res * i
            if ugly not in seen:
                seen.add(ugly)
                heapq.heappush(heap, ugly)

    return res

n = 10
print(nthUglyNumber(n))
